import React from 'react'
import { View, TextInput, StyleSheet } from 'react-native'

const AppTextInput = () => {
  return (
    <View>
      <TextInput style={styles.field} />
    </View>
  )
}

const styles = StyleSheet.create({
  field: {
    width: '100%',
    padding: 2,
  },
})

export default AppTextInput
